import { FormGroup } from '@material-ui/core';
import { Link, useParams } from 'react-router-dom';
import React, { useContext } from 'react';
import { UserContext } from '../../App';
import logo from '../../logos/Group 1329.png';
import './RegisterForm.css';
const RegisterForm = () => {
    const { id } = useParams();
    const [loggedInUser, setLoggedInUser, volunteers, setVolunteers] = useContext(UserContext);
    const findData = volunteers.find(data => data._id === id);
    // console.log(findData);
    const { img, title } = findData;

    const handleClick = (e) => {
        e.preventDefault();
        const FullName = document.getElementById("FullName").value;
        const Email = document.getElementById("Email").value;
        const date = document.getElementById("date").value;
        const Description = document.getElementById("Description").value;
        const title = document.getElementById("title").value;
        const newData = { FullName, Email, date, Description, title };
        console.log(newData);

    }
    return (
        <div>
            <div className="logo">
                <img style={{ height: '80px' }} src={logo} alt="" />
            </div>
            <form action="" onSubmit={handleClick}>
                <FormGroup className="register-form">
                    <h3>Register as a Volunteer</h3>
                    <input type="text" id="FullName" placeholder="Full Name" value={loggedInUser.name} required />

                    <input type="text" id="Email" placeholder="Username or Email" value={loggedInUser.email} required />

                    <input type="date" id="date" placeholder="dd/mm/yyyy" required />

                    <input type="text" id="Description" placeholder="Description" required />


                    <input type="text" id="title" placeholder="title" value={title} required />
                    <br />

                    <input type="submit" className="register-btn" value="Registration" required />

                </FormGroup>
            </form>
        </div>
    );
};

export default RegisterForm;
